import React from 'react';
import './App.css';
import Login from './Login';

function App() {
	const handleLogin = (data) => {
		console.log('User logged in', data);
	};

	return (
		<div className="App">
			<Login onLogin={handleLogin} />
		</div>
	);
}

export default App;
